import React from "react";
import { Navbar, Container } from 'react-bootstrap';
import style from "../styles/nav.css";

function Navigation(props) {
    return (
        <Navbar bg="white">
            <Container>
                // currently displaced 
                <Navbar.Brand herf="#home">
                    <img
                    src="/logo.png"
                    width="265"
                    height="92"
                    className="align-top"
                    alt="T1D logo"
                    />
                </Navbar.Brand>
            </Container>
        </Navbar>
    )
}
export default Navigation;
